import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./RegisterPage.css";

const baseURL = (() => {
  const { hostname } = window.location;
  if (hostname === "127.0.0.1" || hostname === "localhost") {
    return "http://127.0.0.1:5000";
  } else if (hostname.includes("johnnygardner.co.uk")) {
    return "https://www.johnnygardner.co.uk";
  } else {
    return "https://saas-application.onrender.com";
  }
})();

function RegisterPage() {
  const navigate = useNavigate();
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    country: "",
    adults: 1,
    children: 0,
    allergies: "",
    dietary: "",
    mealDays: [],
    firstname: "",
    lastname: "",
    email: "",
    password: "",
    passwordConfirm: "",
  });
  const [error, setError] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleNext = () => {
    setStep(step + 1);
  };

  const handleBack = () => {
    setStep(step - 1);
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setError("");
    
    if (formData.password !== formData.passwordConfirm) {
      setError("Passwords do not match.");
      return;
    }

    try {
      const response = await fetch(`${baseURL}/register`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        const data = await response.json();
        localStorage.setItem("authToken", data.token);
        navigate("/dashboard");
      } else {
        const errorData = await response.json();
        setError(errorData.error || "Registration failed.");
      }
    } catch (err) {
      setError("Network error. Please try again.");
    }
  };

  return (
    <div className="register-container">
      {step === 1 && (
        <div>
          <h2>Select Your Country</h2>
          <select name="country" value={formData.country} onChange={handleChange}>
            <option value="">Select Country</option>
            <option value="UK">United Kingdom</option>
            <option value="US">United States</option>
          </select>
          <button onClick={handleNext}>Next</button>
        </div>
      )}
      {step === 2 && (
        <div>
          <h2>Household Size</h2>
          <input type="number" name="adults" min="1" value={formData.adults} onChange={handleChange} /> Adults
          <input type="number" name="children" min="0" value={formData.children} onChange={handleChange} /> Children
          <button onClick={handleBack}>Back</button>
          <button onClick={handleNext}>Next</button>
        </div>
      )}
      {step === 3 && (
        <div>
          <h2>Allergies & Diet</h2>
          <input type="text" name="allergies" placeholder="Any allergies?" value={formData.allergies} onChange={handleChange} />
          <input type="text" name="dietary" placeholder="Dietary preferences?" value={formData.dietary} onChange={handleChange} />
          <button onClick={handleBack}>Back</button>
          <button onClick={handleNext}>Next</button>
        </div>
      )}
      {step === 4 && (
        <div>
          <h2>Meal Plan Days</h2>
          <input type="text" name="mealDays" placeholder="Which days?" value={formData.mealDays} onChange={handleChange} />
          <button onClick={handleBack}>Back</button>
          <button onClick={handleNext}>Next</button>
        </div>
      )}
      {step === 5 && (
        <div>
          <h2>Create Your Account</h2>
          <input type="text" name="firstname" placeholder="First Name" value={formData.firstname} onChange={handleChange} />
          <input type="text" name="lastname" placeholder="Last Name" value={formData.lastname} onChange={handleChange} />
          <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} />
          <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} />
          <input type="password" name="passwordConfirm" placeholder="Confirm Password" value={formData.passwordConfirm} onChange={handleChange} />
          <button onClick={handleBack}>Back</button>
          <button onClick={handleRegister}>Register</button>
        </div>
      )}
      {error && <div className="error-message">{error}</div>}
    </div>
  );
}

export default RegisterPage;
